        fetch("https://disease.sh/v3/covid-19/historical/all?lastdays=100")
        .then(res => res.json())
        .then(data => {
            setData(data);
            console.log(data);

        })
    }, [])
    return (
        <div>

            <Line data={lData} />

        </div>
    )
}

